import React, { Component } from 'react';
import PropTypes from 'prop-types';
import TodoSubList from './todosublist'
import "../App.css"

class TodoList extends Component {

    sublist() {
        return this.props.todolist.map((input) => (
            <TodoSubList key={input.id} todosublist={input} />
        ))
    }
    render() {
        return (
            <div className="container">

                {this.props.todolist.map((input) => (
                    <div>
                        <div className="item1-container">{input.task}</div>
                        <div className="item2-container">{input.dateB}</div>
                        <div className="item3-container">{input.completed}</div>
                        <div className="item4-container">{input.dateE}</div>
                    </div>

                ))}
            </div >
        );
    }

}
TodoList.propTypes = {
    tasks: PropTypes.array.isRequired
}

export default TodoList;
